INSERT INTO `pengumuman` (`idPengumuman`, `tglPengumuman`, `namaPengumuman`, `isiPengumuman`, `tipePengumuman`) VALUES
(1, '2016-10-27', 'Inventaris Laboratorium Periode Oktober', 'Diharapkan seluruh Asisten Laboratorium untuk melakukan inventaris laboratorium. Saat inventaris pastikan semua perangkat ada dan kondisinya baik. Tulis keadaan perangkat dengan sebenar-benarnya beserta jumlahnya. Jika ada yang rusak  maka tuliskan nama perangkatnya, jumlah yang rusak dan yang baik ditulis dengan jelas.', 'General'),
(2, '2016-11-03', '[DEADLINE]', 'Due date for video content must be submitted maximum on Sunday 6 November 2016, and ready to display on Monday 7 November 2016.\r\nAll photos documentation must be collected to Laboran on Monday 7 November 2016.\r\n\r\n\r\n-Laboran-', 'General'),
(3, '2017-02-06', 'Sertifikat Asisten Laboratorium', 'Sertifikat Asisten Laboratorium FIT semester Ganjil 2016-2017 sudah dapat di ambil di ruang Staff Laboratory. Syarat pengambilan sertifikat : Mengumpulkan Laporan Kegiatan Asisten Laboratorium FIT dan Membuat artikel di Blog Lab fit.lab.telkomuniversity,ac.id sebanyak minimal 2 buah artikel.\r\n\r\nTerima kasih', 'General'),
(4, '2017-08-10', 'Closing Statement for Aslab 2016', 'Bagi Asisten Laboratorium 2016 yang belum mengambil bookyear, dipersilahkan untuk mengambil ke Laboran. Sertifikat juga sudah bisa diambil, dengan syarat menulis artikel sebanyak 2 artikel dan diposting di web lab fit.labs.telkomuniversity.ac.id', 'General'),
(5, '2018-08-27', 'Pengajuan Honor Asisten Laboratorium Periode Agust', 'BAP Asisten Laboratorium mohon diserahkan paling lambat tanggal 28 Agustus 2018 beserta Lembar Pengajuan Honor per Prodi.\r\nJika tidak diserahkan pada tanggal yang ditentukan, maka honor tidak akan diproses.\r\n\r\nTerima kasih', 'General'),
(6, '2018-11-26', 'PUNISHMENT VIDEO LEARNING', 'Daftar nama Aslab fix punishment terkait Video Learning :\r\n1. Ahmad Alfin\r\n2. Aldi Ramdani\r\n3. Ade Hadiyanto\r\n4. Aditama Nugraha\r\n5. Andy Maulana Yusuf\r\n6. Atharizky Ade Santosa', 'General'),
(7, '2018-11-26', 'PENGISIAN JURNAL KEGIATAN ASLAB', 'Dimohon untuk tidak hanya menuliskan &quot;Menjaga admin&quot;, &quot;menjaga keberlangsungan praktikum&quot;, atau deskripsi singkat lainnya dalam satu baris absensi jurnal. Tulis lengkap semua kegiatan yang dilakukan, jika tidak ada sama sekali kegiatan yang dilakukan, maka akan diberikan tugas supaya ada kegiatan yang dilakukan.\r\nJika di bulan depan masih ada deskripsi singkat seperti diatas, maka absensi di jurnal terkait tidak akan dimasukkan ke BAP HONOR.', 'General'),
(8, '2018-12-03', 'PUNISHMENT SHARING KNOWLEDGE', 'Daftar nama Aslab fix punishment terkait Sharing Knowledge :\r\n1. Aslab Komputer', 'General'),
(9, '2019-03-12', 'PUNISHMENT ARTIKEL', 'Daftar nama Aslab fix punishment terkait Artikel :\r\n\r\n1. Aaron Abel (13/02/2019 dan 8/05/2019)\r\n2. Aldi Ramdani (3/05/2019)\r\n3. Atharizky Ade Santosa (06/03/2019)\r\n4. Faisal Kusuma Aji (14/12/2018, 01/02/2019, dan 19/04/2019)\r\n5. Indra Permana Yusup (26/09/2018)\r\n6. Irvan Aulia Rahman (10/10/2018 dan 15/02/2019)\r\n7. Niki Sakti Saestu (22/03/2019)\r\n8. Roni Fernando Simarmata (03/04/2019)\r\n9. Aditama Nugraha (10/05/2019)', 'Practicum Assistant');
